import React from "react";
import "./Header.css";
function Header() {
  return (
    <>
      <div className="header">
        <h1>
          welcome to <span>movies</span> hub
        </h1>
        <p>
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Hic
          necessitatibus velit ipsam. Voluptatem dolorem.
        </p>
      </div>
    </>
  );
}

export default Header;
